import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";
import Para from "./Para";
import List from "./List";

ReactDOM.render(
  <>
    <Heading />
    <Para />
    <List />
    <Heading />
  </>,
  document.getElementById("root")
);
